Atrio Fitness permite a medição de batimentos cardíacos e a velocidade/cadência da sua pedalada com a ajuda dos sensores Bluetooth Atrio ES055 e ES056; 

Mantenha os registros de seus treinos e objetivos.

Através da conexão Bluetooth o Atrio Fitness apresentará as seguintes informações no seu smartphone ou tablet:

Tempo total de exercício;
Consumo de Calorias
Batimento Cardíaco Médio/Máximo (em BPM);
Zonas de batimento cardíaco de acordo com as informações pessoais do usuário;
Velocidade Média (no modo bicicleta);
Cadência Média (no modo bicicleta);
Distância Total (no modo bicicleta);
